import axios from 'axios';
import ProfileInfo from './ProfileInfo.vue';
import Collection from './Collection/Collection.vue';
import Sidebar from './Sidebar.vue';
import Feed from './Feed/Feed.vue';
export default {
  components: {
    appProfileInfo: ProfileInfo,
    appCollection: Collection,
    appSidebar: Sidebar,
    appFeed: Feed
  },
  data: function data() {
    return {};
  },
  methods: {
    reload: function reload() {
      location.reload(); // Analytics

      this.$ga.event({
        eventCategory: 'ERROR',
        eventAction: 'MANUAL_PAGE_REFRESH'
      });
    },
    toggleDragToOrganize: function toggleDragToOrganize() {
      this.$store.dispatch('toggle');
    }
  },
  computed: {
    isUserLoaded: function isUserLoaded() {
      return this.$store.state.isUserLoaded;
    },
    isServerValidationError: function isServerValidationError() {
      return this.$store.state.isServerValidationError;
    }
  },
  created: function created() {
    this.$store.dispatch('user');
    document.body.scrollTop = document.documentElement.scrollTop = 0;
  }
};
